import React from 'react'
import Random from './Random'


function Home( { info } ) {
    const randomNumber=Math.floor(Math.random() * 9)
    const randomCard= info.filter(card => card.id===randomNumber)
    let makeRandom=randomCard.map((item) => {
        <Random jargon={item.jargon} definition={item.definition} sentence={item.sentence} image={item.image} id={item.id}/>
    })
    console.log(makeRandom)

    return (
        <div>
            <h1>Welcome to the home of corporate jargon</h1>
            <div>{makeRandom}</div>
        </div>
    )
}

export default Home
